import React from 'react';
import '../resources/css/custom.css'
import { Container, Col, Row, Navbar} from 'react-bootstrap';


const Home = () => {
    const SideBar = (props) => {
        return (
            <div className='side-bar'>
                <Col>
                    <Row className='side-bar-menu'>
                        <a href="/">MenuA</a>
                    </Row>
                    <Row className='side-bar-menu'>
                        <a href="/">MenuB</a>
                    </Row>
                </Col>
            </div>
        )
    }

    const MainSection = (props) => {
        return (
            <div className='main-section'>
                <p>Main section</p>
                <br/><br/><br/>
                <p>end</p>
            </div>
        )
    }
    return (
        <div>
            <Navbar>
                    <a href="/">
                        <img className='logo' src={require('../resources/img/dearToday.PNG')} />
                    </a>

            </Navbar>
                <Row className="full-page">
                    <Col className='d-none d-sm-block mt-0' lg={2} sm={3}><SideBar/></Col>
                    <Col classname='mt-0'lg={10} sm={9} mt={0}><MainSection /></Col>
                </Row>
        </div>
    );
};

export default Home;
